import React from 'react'
import { Link } from 'react-router-dom'
import './logo.scss'

const Logo = () => {
  return (
    <div>
      <Link to={'Main.jsx'} className='asideBar__logo'>
        Tasks Book
      </Link>
    </div>
  )
}

export default Logo
